const ACTIONS = {
  JOIN: "join",
  JOINED: "joined",
  DISCONNECTED: "disconnect",
  CODE_CHANGED: "codeChanged",
  SYNC_CODE: "syncCode",
  LEAVE: "leave",
};

module.exports = ACTIONS;
